import React from 'react';
import './Nav.css';


const Nav = () =>{
    return(
        <div className="navContainer">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Work</li>
                <li>Contact</li>
            </ul>
        </div>
    )
}

export default Nav;
